import React from 'react'
import {status} from "./imgs.js";
import Home1stcard from './Home1stcard.jsx';
import "./home1stcomponent.css"

function createcard(props)
{
    return(
    <div key={props.id} >
        <Home1stcard  val={props.pic} textval={props.text}/>
        
    </div>
    );
}

export default function Home1stcomponent() {
    return (
    <div>
        <div className='homecmp'>
            {status.map(createcard)}
        </div>
        <div>
            <div>
                

            </div>
            <div>

            </div>
            <div>

            </div>


        </div>
    </div>
    )
}
